script: |
  super -f text -I q4033.spq | sort > q4033.out

inputs:
  - name: q4033.spq
    data: |
      SELECT + col1 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col2 * - - 37 * - col0 * - 89 NOT BETWEEN - col2 - - col1 AND - + col0 + - col1 + - col2;
  - name: tab2

outputs:
  - name: q4033.out
    data: |
